$(document).ready(function(){var t=document.querySelectorAll(".item__delete");if(0<t.length)for(let e=0;e<t.length;e++){const a=t[e];a.addEventListener("click",()=>{var e=$(a).siblings(".item__profile").children(".item__number").children("span").text(),t=window.location.pathname.slice(1).split("/"),t=t[1]+"_"+t[0];$.ajax({type:"POST",url:"/",data:{database:t,phone:e},success:function(e){e?location.reload():alert("Erorr")}})})}$(".leads__export").click(function(){var e=window.location.pathname.slice(1).split("/"),e=e[1]+"_"+e[0];$.ajax({type:"POST",url:"export/",data:{database:e},success:function(t){if(t){t=encodeURI("data:text/csv;charset=utf-8,"+t);let e=document.createElement("a");e.setAttribute("href",t),e.setAttribute("download","leads.csv"),document.body.appendChild(e),e.click()}else alert("Erorr")}})})});